import React from 'react';
import Login from './components/SIgn';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar'; // ✅ Import Navbar
import Home from './components/Home';
import Profile from './components/Profile';
import Footer from './components/Footer';
import Dashboard from "./components/Dashboard";
import DataCollection from "./components/DataCollection";
import ArI from "./components/ArI";
import AlertsReports from './components/AlertsReports';
import User from './components/User';
import SystemSettings from './components/SystemSettings';

function App() {
  return (
    <Router>
      <div className="app-container">

        {/* ✅ Navbar is always present */}
        <Navbar /> 

        <main className="main-content">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/profile" element={<Profile />} />
            <Route path="/ai-analysis" element={<ArI />} />
            <Route path="/dashboard" element={<Dashboard />} />
            <Route path="/data-collection" element={<DataCollection />} />
            <Route path="/AlertsReports" element={<AlertsReports />} />
            <Route path="/settings" element={<SystemSettings />} />
            <Route path="/user" element={<User currentUserRole="Admin" />} />
          </Routes>
        </main>

        {/* Footer */}
        <Footer />
      </div>
    </Router>
  );
}

export default App;
